import React,{useEffect, useState} from 'react'

function UseEffect1() {
  const [count,setCount] = useState(0)

  useEffect(()=>{
      document.title = `you clicked ${count} times`
  }) 
  return (
    <div>
      <button onClick={()=> setCount(count+1)}>click on this {count}</button>
    </div>
  )
}

export default UseEffect1
